import fetch from 'isomorphic-fetch';
export function postContact(body) {
  return fetch("http://localhost:3000/test/api/auth/contact", {
    method: 'POST',
    headers: {
      'Accept': 'application/json',
      "Content-Type": "application/json"
    },
    cache: 'default',
    mode: 'cors',
    body: JSON.stringify(body)
  }).then(resp => {
    return resp.json();
  });
}
